import './App.css';
import { Button, Card } from './components/TodoList';
function App() {
  return (
    <div className="App">
      <wraper >

        <Card style={{ width: '18em',  color : { red } }}>
          <p style={{ padding: '2em 3em 0 3em' }}>
            <img src={"./assets/images.agenda.png"} alt="" style={{ width: '100%' }} />
          </p>

          <div style={{ padding: '1em 1.2em' }}>

          </div>
        </Card>
      </wraper>
    </div>
  );
}

export default App;
